import { Routes ,Route, BrowserRouter } from 'react-router-dom';
import Home from "../pages/Home";
import Footer from "./Footer";
import Header from "./Header";

export default function Body(){
    return(
      <BrowserRouter>
        <Header/>
        <Routes>
          <Route path="/" element={Home} />
        </Routes>
        <Footer/>
      </BrowserRouter>

    )
    
}
